styles:
.gui-bold {
	font-weight: bold;
}

.gui-italic {
	font-style: italic;
}
@import 'variables';


.gui-header {
	background: $header-background;
	border-bottom: 1px solid $border-color;
	height: $row-height + 2;

	.gui-header-cell {
		border-right: 1px solid transparent;
		box-sizing: border-box;
		cursor: pointer;
		line-height: 1em;
		overflow: hidden;
		padding: 0 8px;
		padding-right: 16px;
		position: relative;
		white-space: nowrap;
		text-overflow: ellipsis;
		display: flex;
		justify-content: space-between;

		&:last-of-type {
			border-right: 0;
		}

		.gui-header-menu {
			display: flex;

			.gui-header-menu-icon {
				display: none;
				background: url('data:image/png;base64,');
				height: 16px;
				width: 16px;
				margin-right: 8px;
			}

			.gui-sort {
				display: none;
				height: 16px;
				width: 16px;
			}

			.gui-sort-asc {
				background: url('data:image/png;base64,');
				background-size: contain;
				background-repeat: no-repeat;
				background-position: center;
				display: block;
			}

			.gui-sort-desc {
				background: url('data:image/png;base64,');
				background-size: contain;
				background-repeat: no-repeat;
				background-position: center;
				display: block;
			}
		}

		&:hover {
			background: $header-background-hover;

			.gui-header-menu {
				.gui-header-menu-icon {
					display: block;
				}
			}
		}
	}

}

.gui-header-bottom {

	.gui-header {
		border-bottom: 0;
		border-top: 1px solid $border-color;
	}

}

gui-structure {
	background: $background-color;
	box-sizing: border-box;
	color: $text-color;
	display: block;
	font-family: $font-family;
	font-size: $font-size;
	position: relative;

	* {
		box-sizing: border-box;
	}

	gui-structure-search-bar {

		form {
			display: flex;
			background: $white;
			height: $row-height;
			border-bottom: 1px solid $border-color;

			.gui-search-icon {
				position: absolute;
				top: 5px;
				left: 10px;
				background-image: url('data:image/png;base64,');
				width: 17px;
				height: 17px;
			}

			input {
				border: none;
				padding: $net-half-width $net-half-width $net-half-width 38px;
				height: 100%;
				width: 100%;
			}
		}
	}

	gui-structure-header {
		display: block;
		height: 100%;
		width: 100%;

		gui-structure-header-filters.gui-header {
			height: 32px;

			.gui-header-cell {
				padding: 4px;

				input {
					position: relative;
					box-sizing: border-box;
					border: {
						style: solid;
						width: 1px;
						color: $border-color;
					}
					font: {
						size: 13px;
					}
					padding: 2px;
					height: 100%;
					width: 100%;
				}
			}
		}
	}
}

gui-structure-container {
	display: block;
	height: 100%;
	overflow: auto;
	overflow-x: hidden;
	position: relative;
	width: 100%;

	.gui-structure-container {
		box-sizing: border-box;
		height: 100%;
		position: absolute;
		width: 100%;

		.gui-content {
			height: 100%;
			position: relative;

			.gui-row {
				height: $row-height;
				position: absolute;
				width: 100%;

				&:hover {
					background: $row-hover-background;
				}

				&.selected {
					background: $row-selected-background;
				}

				.gui-cell {
					border-right: 1px solid transparent;
					box-sizing: border-box;
					line-height: 1em;
					overflow: hidden;
					padding: 0;
					white-space: nowrap;

					.gui-button {
						padding: 0;
					}

					.gui-cell-boolean {
						justify-content: center;
					}

					.gui-checkbox {
						position: absolute;
						top: 4px;
						padding-left: 22px;
						line-height: 0;
					}

					.gui-chip {
						margin: 0;
						padding: 2px 8px;
					}

					.gui-badge {
						padding: 0;
					}

					.gui-input {
						background: transparent;
						font-size: $font-size;
						border: {
							style: none;
							radius: 0;
						}
						padding: 0;
					}
				}
			}
		}
	}

	gui-structure-cell {
		display: inline-block;

		> span {
			align-items: center;
			display: flex;
			padding: 0 8px;
			height: 100%;
			width: 100%;
		}

		.gui-cell-edit-mode {
			border: 2px solid #2185d0;
			height: 100%;
			padding: 6px;

			gui-boolean-edit {
				margin-left: calc(50% - 11px);
			}
		}

	}
}

.gui-vertical-grid {

	.gui-structure-aggregation-cell,
	gui-structure-container .gui-content .gui-row .gui-cell,
	gui-structure-header .gui-header .gui-header-cell {
		border-right: 1px solid $border-color;

		&:last-of-type {
			border-right: 0;
		}
	}

}

.gui-horizontal-grid gui-structure-container {

	.gui-row {

		.gui-cell {
			border-bottom: 1px solid $border-color;
		}

		&:last-of-type {
			.gui-cell {
				border-bottom: 0;
			}
		}
	}
}

.gui-rows-odd {
	.gui-row:nth-child(odd) {
		background: $row-colored-background;
	}
}

.gui-rows-even {
	.gui-row:nth-child(even) {
		background: $row-colored-background;
	}
}

gui-structure-summary {
	box-sizing: border-box;
	background: $header-background;
	border-top: {
		style: solid;
		width: 1px;
		color: $border-color;
	}
	display: flex;
	justify-content: space-between;
	padding: 0 6px;
	width: 100%;
	line-height: $row-height;

	p {
		margin: 0;

		b {
			font-weight: bold;
		}
	}

	div {
		color: $text-color;
		cursor: pointer;

		button {
			background: $gray;
			border: {
				style: solid;
				width: 1px;
				color: transparent;
				radius: 50%;
			};
			color: $white;
			cursor: pointer;
			font-weight: bold;
			font-family: "Comic Sans MS", cursive, sans-serif;
			width: 16px;
			height: 16px;
			line-height: 14px;
			padding: 0;

			&:focus {
				outline: none;
				box-shadow: 0 0 4px $gray
			}
		}
	}
}

.gui-structure-info-panel {
	box-sizing: border-box;
	display: flex;
	flex-direction: column;
	width: 160px;
	padding: 16px;
	font-family: Roboto, sans-serif;

	ul {
		list-style: none;
		margin: 0;
		padding-left: 10px;
	}

	p {
		font-weight: bold;
		margin: 0 0 0 0;
		color: $text-color;
	}

	p:nth-child(2) {
		margin: 0 0 12px 0;
	}

	p:nth-child(5) {
		margin: 8px 0 0 0;
	}

	a {
		text-decoration: none;
		color: $blue;
		margin: 0 0 8px 0;
	}

	a:hover {
		color: $blue-lighter;
	}
}

.gui-structure-border {
	border: 1px solid $border-color;
}

gui-structure-aggregation-panel {
	background: $header-background;
	display: flex;

	&.gui-structure-aggregation-panel-bottom .gui-structure-aggregation-cell {
		border-top: 1px solid $border-color;
	}

	&.gui-structure-aggregation-panel-top .gui-structure-aggregation-cell {
		border-bottom: 1px solid $border-color;
	}

	.gui-structure-aggregation-cell {
		font-size: 14px;
	}

	.gui-structure-aggregation-value {
		display: flex;
		justify-content: space-between;
		line-height: 1em;
		height: 30px;
		padding: 8px 6px;
		overflow: hidden;

		div {

			.gui-math-symbol {
				position: relative;
				top: -1px;
			}
		}

		.gui-mean,
		.gui-median {
			position: relative;
			display: flex;
			flex-direction: column;
		}

		.gui-mean {
			span:nth-child(1) {
				position: absolute;
				top: -15px;
				left: 1px;
			}
		}

		.gui-median {
			span:nth-child(1) {
				position: absolute;
				top: -8px;
				left: 1px;
			}
		}

	}

}

@keyframes fadeIn {
	from {
		opacity: 0;
	}

	to {
		opacity: 1;
	}
}

@keyframes fadeOut {
	from {
		opacity: 1;
	}

	to {
		opacity: 0;
	}
}

.gui-loading {
	animation-duration: 0.2s;
	align-content: center;
	background: rgba(255, 255, 255, 0.8);
	border: 1px solid transparent;
	height: 100%;
	display: flex;
	justify-content: center;
	left: 0;
	opacity: 0;
	position: absolute;
	top: 0;
	width: 100%;
	visibility: hidden;

	gui-spinner {
		align-self: center;
	}

	&.gui-loader-hidden {
		animation-name: fadeOut;
		opacity: 0;
		visibility: visible;
		z-index: -1;
	}

	&.gui-loader-visible {
		animation-name: fadeIn;
		opacity: 1;
		visibility: visible;
		z-index: 1;
	}
}
@import 'variables';

gui-structure-paging {
	display: flex;
	justify-content: flex-end;
	align-items: center;
	padding: #{$net-size / 2}px;

	> * {
		padding-left: #{$net-size * 2}px;
	}

	gui-structure-paging-select {

		span {
			display: inline-block;
			margin: 0 $net-half-width 0 0;
		}
	}

	gui-structure-paging-navigator {

		button {
			margin-right: $net-half-width;

			&:last-of-type {
				margin-right: 0;
			}
		}
	}

	gui-structure-paging-stats {

		span {
			display: inline-block;
			margin: 0 2px 0 0;
		}
	}

	gui-structure-alternative-paging-navigator {
		display: flex;
		padding: 0 8px;
		line-height: 34px;

		gui-structure-alternative-paging-pages {
			display: flex;
			justify-content: center;

			.gui-paging-page {
				display: none;
				user-select: none;
			}

			.gui-paging-visible-page {

				.gui-paging-page {
					display: block;
					cursor: pointer;
					padding: 0 8px;
				}
			}

			.gui-paging-active-page {
				font-weight: bold;
				color: black;
				box-shadow: 0 1px 0 0 black;
			}
		}

		.gui-button {
			margin: 0 4px;
			background: transparent;
			padding: 0;

			&:hover {
				background: transparent;
			}
		}
	}

	&.gui-structure-paging-bottom {
		border-top: 1px solid $border-color;
	}

	&.gui-structure-paging-top {
		border-bottom: 1px solid $border-color;
	}

}
@media (max-width: 500px) {

	gui-structure-paging {

		> * {
			padding-left: 4px;
		}

		gui-structure-paging-stats {
			padding-left: 4px;
		}
	}
}
.gui-header {
	display: flex;

	.gui-header-cell {
		align-items: center;
		display: flex;
	}
}

.gui-content {
	display: flex;
	flex-direction: column;

	.gui-row {
		display: flex;

		.gui-cell {
			display: inline-block;
		}
	}
}

.gui-cell {

	.gui-checkbox {
		display: block;
	}

	.gui-chip {
		margin: 0;
		padding: 2px 8px;
	}

	.gui-input {
		font-size: 11px;
		display: block;
		padding: 2px 4px;
		width: 86%;
	}

	.gui-button {
		padding: 2px 8px;
	}

	.gui-cell-number {
		display: block;
		text-align: right;
		width: 100%;
	}

	.gui-cell-boolean {
		align-items: center;
		display: flex;
		height: 100%;
		text-align: center;
		width: 100%;
	}
}
$font-family: Roboto, "Helvetica Neue", sans-serif;
$gray: #808080;

.gui-material {

	&.gui-structure,
	.gui-header {
		font-family: $font-family;
	}

	.gui-structure-header .gui-header {
		font-weight: bold;
		color: $gray;

		.gui-header-cell {
			border-right: 1px solid transparent;
		}
	}

	.gui-cell {

		.gui-button {
			padding: 0;
		}

		.gui-badge {
			padding: 0;
		}

	}

	&.gui-vertical-grid gui-structure-container {

		.gui-row {

			.gui-cell {
				border-right: 1px solid transparent;
			}
		}
	}

}
$black: #121212;
$gray: #424242;
$gray-light: #616161;
$gray-dark: #212121;

$background: lighten($black, 15);
$header-text: #BDBDBD;
$dark-text: #cccccc;
$background-hover: lighten($background, 10);
$row-colored-background: lighten($black, 10);
$row-selected-background: #7cb9f652;
$horizontal-grid-color: #666666;
$box-shadow: 5px 5px 10px 2px lighten($black, 5);


.gui-dark {

	&.gui-structure,
	.gui-header {
		background: $background;
		color: $dark-text;
	}

	.gui-structure-border {
		border: none;
		box-shadow: $box-shadow;
	}

	.gui-structure-header {

		.gui-header {
			color: $header-text;
			border-bottom-color: $horizontal-grid-color;

			.gui-header-cell {
				border-right: 1px solid transparent;

				&:hover {
					background: $background-hover;
				}
			}
		}
	}

	gui-structure-container {

		.gui-structure-container {

			.gui-content {

				.gui-row {

					&:hover {
						background: $background-hover;
					}

					&.selected {
						background: $row-selected-background;
					}

				}
			}
		}
	}

	&.gui-rows-odd {

		.gui-row:nth-child(odd) {
			background: $row-colored-background
		}
	}

	&.gui-rows-even {

		.gui-row:nth-child(even) {
			background: $row-colored-background
		}
	}

	.gui-horizontal-grid gui-structure-container {
		.gui-row {
			.gui-cell {
				border-bottom-color: $horizontal-grid-color;
			}
		}

	}

	&.gui-vertical-grid gui-structure-container {

		.gui-row {

			.gui-cell {
				border-right: 1px solid transparent;
			}
		}
	}

	gui-structure-paging {
		&.gui-structure-paging-bottom {
			border-top-color: $horizontal-grid-color;
		}

		&.gui-structure-paging-top {
			border-bottom-color: $horizontal-grid-color;
		}
	}

	::-webkit-scrollbar {
		width: 15px;
	}

	::-webkit-scrollbar-track {
		background: $gray-light;
	}

	::-webkit-scrollbar-thumb {
		background: $gray;
	}

	::-webkit-scrollbar-thumb:hover {
		background: $gray-dark;
	}

}
